fields.description:
* Forward facing;
* For baby between 9-36kg (9 months-12 years old);
* Standard Groups: Group 1,2,3;
* 5-point harness;
* Standard crash test;
* Spacious backrest and base for comfortable sitting;
* Easy to convert to be backless booster;
* Multi-adjustable headrest positions;
* EPE foam in the backrest and base to provide comfortable sitting;
* Comfortable, breathable fabric material, more at ease;
